import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import cards from "./cards.json";
import Wrapper from "./components/Wrapper";
import Counter from "./components/Counter"
import Card from "./components/Card"



function App(){
  return(
    <Wrapper>
      <Card name={cards[0].name} image={cards[0].image}></Card>
      <Card name={cards[1].name} image={cards[1].image}></Card>
      <Card name={cards[2].name} image={cards[2].image}></Card>
      <Card name={cards[3].name} image={cards[3].image}></Card>
      <Card name={cards[4].name} image={cards[4].image}></Card>
      <Card name={cards[5].name} image={cards[5].image}></Card>
      <Card name={cards[6].name} image={cards[6].image}></Card>
      <Card name={cards[7].name} image={cards[7].image}></Card>
      <Card name={cards[8].name} image={cards[8].image}></Card>
      <Card name={cards[9].name} image={cards[9].image}></Card>
      <Card name={cards[10].name} image={cards[10].image}></Card>
      <Card name={cards[11].name} image={cards[11].image}></Card>

    </Wrapper>
  )
}

export default App;
